import Particles from "../Particles";
import { Wrapper, TypeWriterWrapper } from "./styles";
import Typewriter from "../Typewriter";
import { HoverButton } from "../button/";
const Homepage = () => {
	return (
		<Wrapper>
			<TypeWriterWrapper>
				<Typewriter
					strings={[
						"Web Development",
						"Backend Development",
						"Mobile Development",
						"Continuous Integration",
						"Continuous Deployment"
					]}
				/>
				<HoverButton ghost>Ghost</HoverButton>
			</TypeWriterWrapper>

			<Particles />
		</Wrapper>
	);
};
export default Homepage;
